import './clientes.css';
import React, { useState, useMemo, useRef } from 'react';
import { useHistory } from "react-router-dom";

function Clientes() {
  const history = useHistory();
  const [isSearchVisible, setIsSearchVisible] = useState(false);
  const [busca, setBusca] = useState('');
  const [sortDirection, setSortDirection] = useState('asc');
  const [isFilterMenuVisible, setIsFilterMenuVisible] = useState(false);
  const searchInputRef = useRef(null);

  const toggleSearch = () => {
    setIsSearchVisible(!isSearchVisible);
    setTimeout(() => {
      if (searchInputRef.current) {
        searchInputRef.current.focus();
      }
    }, 0);
  };

  const toggleFilterMenu = () => {
    setIsFilterMenuVisible(!isFilterMenuVisible);
  };

  const handleSort = (direction) => {
    setSortDirection(direction);
    setIsFilterMenuVisible(false);
  };

  const handleClientClick = (clienteId) => {
    history.push(`/visualizarcliente/${clienteId}`);
  };

  const normalizeText = (text) => {
    return text.normalize("NFD").replace(/[\u0300-\u036f]/g, "").toLowerCase();
  };

  const clientesFiltrados = useMemo(() => {
    const normalizedBusca = normalizeText(busca);
    // Simula uma lista de clientes para demonstração
    const clientesSimulados = [
      { id_cliente: 1, nome: "João Silva" },
      { id_cliente: 2, nome: "Maria Santos" },
      { id_cliente: 3, nome: "Pedro Oliveira" }
    ];
    
    const filteredClientes = clientesSimulados.filter((cliente) =>
      normalizeText(cliente.nome).includes(normalizedBusca)
    );
    return filteredClientes.sort((a, b) => {
      if (sortDirection === 'asc') {
        return a.nome.localeCompare(b.nome);
      } else {
        return b.nome.localeCompare(a.nome);
      }
    });
  }, [busca, sortDirection]);

  return (
    <div className="Web">
      <header className="Web-header">
        <img src="/logotipo.svg" className="Web-logotipo" alt="Dogvideo Logomarca" />
        <div className="footer-bar"></div>
      </header>

      <div className="header-icons">
        <div className="icon-container" onClick={toggleSearch}>
          <img src="/search.svg" alt="Ícone de busca" className="icon" />
        </div>
        <div className="icon-container" onClick={() => history.push('/criarcliente')}>
          <img src="/add.svg" alt="Ícone de adicionar" className="icon" />
        </div>
        <div className="icon-container" onClick={toggleFilterMenu}>
          <img src="/filter.svg" alt="Ícone de filtro" className="icon" />
        </div>
      </div>

      {isSearchVisible && (
        <div className="search-bar">
          <input
            type="text"
            value={busca}
            ref={searchInputRef}
            onChange={(ev) => setBusca(ev.target.value)}
            placeholder="Pesquisar cliente"
            className="search-input"
          />
        </div>
      )}

      {isFilterMenuVisible && (
        <div className="filter-menu">
          <button onClick={() => handleSort('asc')} className="filter-button">
            Ordenar A-Z
          </button>
          <button onClick={() => handleSort('desc')} className="filter-button">
            Ordenar Z-A
          </button>
        </div>
      )}

      <img
        src="/Back.svg"
        alt="Ícone de voltar"
        className="back-icon"
        onClick={() => history.push("/admin")}
      />

      <div className="client-list">
        {clientesFiltrados.map((cliente) => (
          <div className="client-item" key={cliente.id_cliente}>
            <span onClick={() => handleClientClick(cliente.id_cliente)}>{cliente.nome}</span>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Clientes;
